        /** @type {?} */
        const hours = Math.floor(this.interval / 3600);
        /** @type {?} */
        const minutes = Math.floor((this.interval - (hours * 3600)) / 60);
        /** @type {?} */
        const seconds = (this.interval - (hours * 3600) - (minutes * 60));
